import React from 'react';
import Sidebar from '../components/Sidebar/Sidebar';
import Dashboard from '../components/Dashboard/Dashboard';
import './styles.css';

const DashboardPage = () => {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <Dashboard />
    </div>
  );
};

export default DashboardPage;
